  namespace: System.Diagnostics
  summary: Provides trace event data specific to a thread and a process.
  remarks: "> [!NOTE]\n>  The <xref:System.Diagnostics.TraceEventCache> class, designed as a performance optimization for trace listener calls, is of interest only to developers creating custom trace listeners.  \n  \n The <xref:System.Diagnostics.TraceEventCache> class is used as a parameter in tracing methods to accurately identify the source of a trace event. Examples of methods that use <xref:System.Diagnostics.TraceEventCache> are <xref:System.Diagnostics.TraceListener.TraceEvent%2A?displayProperty=fullName> and <xref:System.Diagnostics.TraceFilter.ShouldTrace%2A?displayProperty=fullName>. The <xref:System.Diagnostics.TraceEventCache.LogicalOperationStack%2A> property contains data that can be used to correlate the trace with related traces."
