  nameWithType: TraceEventCache.Callstack
  fullName: TraceEventCache.Callstack
  type: Property
  assemblies:
  - System
  - netstandard
  - System.Diagnostics.TraceSource
  namespace: System.Diagnostics
  summary: Gets the call stack for the current thread.
  remarks: The <xref:System.Diagnostics.TraceEventCache.Callstack%2A> property gets the call stack from the <xref:System.Environment.StackTrace%2A> property of the <xref:System.Environment> class. The property value lists method calls in reverse chronological order. That is, the most recent method call is described first. One line of stack trace information is listed for each method call on the stack. For more information, see <xref:System.Environment.StackTrace%2A>.
  syntax:
    content: public string Callstack { get; }
    return:
      type: System.String
      description: A string containing stack trace information. This value can be an empty string ("").
  overload: System.Diagnostics.TraceEventCache.Callstack*
