- uid: System.Diagnostics.TraceEventCache.LogicalOperationStack
  commentId: P:System.Diagnostics.TraceEventCache.LogicalOperationStack
  id: LogicalOperationStack
  parent: System.Diagnostics.TraceEventCache
  langs:
  - csharp
  name: LogicalOperationStack
  nameWithType: TraceEventCache.LogicalOperationStack
  fullName: TraceEventCache.LogicalOperationStack
  type: Property
  assemblies:
  - System
  - netstandard
  - System.Diagnostics.TraceSource
  namespace: System.Diagnostics
  summary: Gets the correlation data, contained in a stack.
  remarks: The correlation data is stored as an object in the call context with the name "System.Diagnostics.Trace.CorrelationManagerSlot". The <xref:System.Diagnostics.CorrelationManager> class provides methods used to store a logical operation identity in a thread-bound context and automatically tag each trace event generated by the thread with the stored identity. The <xref:System.Diagnostics.CorrelationManager> is accessed through the <xref:System.Diagnostics.Trace.CorrelationManager%2A?displayProperty=fullName> property. Each call to the <xref:System.Diagnostics.CorrelationManager.StartLogicalOperation%2A> method pushes a new logical operation identity onto the stack. Each call to the <xref:System.Diagnostics.CorrelationManager.StopLogicalOperation%2A> method pops a logical operation identity from the stack
  syntax:
    content: public System.Collections.Stack LogicalOperationStack { get; }
    return:
      type: System.Collections.Stack
      description: A <xref href="System.Collections.Stack"></xref> containing correlation data.
  overload: System.Diagnostics.TraceEventCache.LogicalOperationStack*
